import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import NavbarIn from "./navbar/NavbarIn";

class Profile extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <NavbarIn />
        <br />
        <br />
        <br />
        <h1 className="tc white i f1 font">My Profile</h1>
        <br />
        <br />
        <Container className='tc f3 solidBR'>
          <Row>
            
       

            <Col className="pa5">
              <u><i className='f2'>General settings</i></u> <br/>
              <a className='black hover' href="/">- Current account statement</a><br/> 
              <a className='black hover' href="/">- Betting History</a><br/> 
              <a className='black hover' href="/">- Full Fincial statement</a><br/> 

              <a className='black hover' href="/">- Delete your Account</a><br/> 
            </Col>
          </Row>
        
        </Container>
      </div>
    );
  }
}

export default Profile;
